import React from 'react';
import Footer from '../components/Footer';
import '../styles/form.css';

function Form() {
  return (
    <div>
      <form>
        <fieldset>
          <legend>Junte-se ao time</legend>
          <p>
            <input type="radio" name="size" id="size_1" value="small" />
            <label htmlFor="size_1"> Small</label>
          </p>
        </fieldset>
      </form>
      <footer>
        <Footer />
      </footer>
    </div>
  );
}

export default Form;
